gOD(){return"\u041d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0440\u0443\u043a\u043e\u043f\u0438\u0441\u0438 \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u0438\u0442 \u043e\u0442 \u0433\u043e\u0440\u043e\u0434\u0430 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0438\u044f \u0432 \u0415\u0433\u0438\u043f\u0442\u0435, \u0433\u0434\u0435 \u043e\u043d\u0430 \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0430\u0441\u044c \u0432 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0432\u0440\u0435\u043c\u0435\u043d\u0438. \u0412 XVII \u0432\u0435\u043a\u0435 \u041f\u0430\u0442\u0440\u0438\u0430\u0440\u0445 \u041a\u0438\u0440\u0438\u043b\u043b \u041b\u0443\u043a\u0430\u0440\u0438\u0441 \u043f\u0435\u0440\u0435\u0432\u0451\u0437 \u0435\u0451 \u0438\u0437 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0438\u0438 \u0432 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c, \u0430 \u0437\u0430\u0442\u0435\u043c \u043e\u043d\u0430 \u0431\u044b\u043b\u0430 \u043f\u0435\u0440\u0435\u0434\u0430\u043d\u0430 \u041a\u0430\u0440\u043b\u0443 I \u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u043c\u0443."},
gOz(){return"\u0421 \u0442\u043e\u0447\u043a\u0438 \u0437\u0440\u0435\u043d\u0438\u044f \u0442\u0435\u043a\u0441\u0442\u043e\u043b\u043e\u0433\u0438\u0438, \u043a\u043e\u0434\u0435\u043a\u0441 \u0438\u043c\u0435\u0435\u0442 \u0441\u043c\u0435\u0448\u0430\u043d\u043d\u044b\u0439 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440: \u0442\u0435\u043a\u0441\u0442 \u0415\u0432\u0430\u043d\u0433\u0435\u043b\u0438\u0439 \u043e\u0442\u043d\u043e\u0441\u0438\u0442\u0441\u044f \u043a \u0432\u0438\u0437\u0430\u043d\u0442\u0438\u0439\u0441\u043a\u043e\u043c\u0443 \u0442\u0438\u043f\u0443 (\u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u044f III), \u0442\u043e\u0433\u0434\u0430 \u043a\u0430\u043a \u043e\u0441\u0442\u0430\u043b\u044c\u043d\u0430\u044f \u0447\u0430\u0441\u0442\u044c \u041d\u043e\u0432\u043e\u0433\u043e \u0417\u0430\u0432\u0435\u0442\u0430 \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0438\u0442 \u043a \u0430\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0438\u0439\u0441\u043a\u043e\u043c\u0443 \u0442\u0438\u043f\u0443 (\u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u044f I)."},
