gPr(){return"\u041f\u043e\u0440\u0444\u0438\u0440\u0438\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u0434\u0435\u043a\u0441 (P<sup>apr</sup> 025)"},
